--
-- Estructura de tabla para la tabla `pacientes`
--

CREATE TABLE `pacientes` (
  `id` int(11) NOT NULL,
  `usuario_id` int(11) DEFAULT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `direccion` varchar(255) DEFAULT NULL,
  `nombre` varchar(100) NOT NULL,
  `apellido` varchar(100) NOT NULL,
  `dni` varchar(20) NOT NULL,
  `genero` enum('Masculino','Femenino','Otro') NOT NULL,
  `telefono` varchar(20) DEFAULT NULL,
  `notas` text DEFAULT NULL,
  `foto` mediumblob DEFAULT NULL COMMENT 'Datos binarios de la foto del paciente',
  `edad` int(11) GENERATED ALWAYS AS (timestampdiff(YEAR,`fecha_nacimiento`,curdate())) VIRTUAL COMMENT 'Edad calculada dinámicamente',
  `fecha_registro_sistema` timestamp NOT NULL DEFAULT current_timestamp(),
  `activo` tinyint(1) NOT NULL DEFAULT 1 COMMENT '1 para activo, 0 para inactivo/deshabilitado'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

